import React, { Component } from "react";
import NewsItem from "./NewsItem";

export default class News extends Component {
 


constructor()
{
  super();
  console.log('hey they  are ccalling you useless');
  this.state={
  articles: [],
  loading:false,
  page:1
}
}

async componentDidMount()
{
  let url="https://newsapi.org/v2/everything?domains=wsj.com&apiKey=cecbc869f0c145c0a74ab682074be099&page=1";

 let data=await fetch(url)
 let parsedData = await data.json();
 
  this.setState({
    articles: parsedData.articles
  });
  
}
    
  render() {
    return (
      <div className="container my-3">
        <h2>Top Headlines</h2>

        
        <div className="row">
        {this.state.articles.map((element) => {
          return <div className="col-md-4"  key={element.url}>
            <NewsItem title={element.title} description={element.description} imageURL={element.urlToImage} url={element.url}/>
          </div>
        })}
        </div>

        <div className="container d-flex justify-content-center">
        <button type="button" class="btn btn-dark" onClick={this.handleclickNext}>Previous</button>
<button type="button" class="btn btn-dark" onClick={this.handleclickNext}>Next</button>
        </div>
      </div>
    );
  }
}
